import { Link } from "react-router-dom";
import { Nav, Container, Navbar } from "react-bootstrap";

const Menu = () => {
  const custom = {
    backgroundImage: "linear-gradient(-90deg, #a3278f 0%, #e52f50 100%)",
    margin: "0",
    padding: "0",
  };
  return (
    <Navbar expand="lg">
      <Container></Container>
    </Navbar>
  );
};

export default Menu;
